import React, {useEffect} from "react";
import WebFont from 'webfontloader';

export default function Header() {
    useEffect(() => {
        WebFont.load({
          google: {
            families: ['Droid Sans', 'Chilanka']
          }
        });
       }, []);

  return (
    <div className="card">
      <h1 className="font-link text-white text-center">
        The Writer's Cave
      </h1>
    </div>
  );
}
